import React, { Component } from 'react';
import TodoContent from './TodoContent';

export default class TodoContentParent extends Component {
    constructor(props){
        super(props);
        this.state = {
            newEdit: false
        };}
    render() {
        return (
            <div className='TDParent'>
                <h1>나의 할일들</h1>
                <button className='button'>추가</button>
                <TodoContent/>
            </div>
        )
    }
    }
